import React from 'react';
const tools = [
    {
        id: 1,
        text:"high"
    },{
        id: 2, 
        text:"low"
    },{
        id:3,
        text:"average"
    }]
const Tools = () => {
    return (
        <>
        {tools.map((tool)=>(<button cl>{tool.text}</button>))}

        </>
    )



};

export default Tools;
